  flex: 1;
`;

const Image = styled.img`
  width: 100%;
`;

const InfoContainer = styled.div`
  flex: 1;
`;

const Title = styled.h1`

`;

const Desc = styled.p`

`;

const Price = styled.span`

`;


const Product = () => {
  return (
  <Container>
    <Navbar/>
    <Announcement/>
    <Wrapper>
      <ImgContainer>
          <Image src="../assets/images/theruntz.webp"/>
      </ImgContainer>
      <InfoContainer>
        <Title> The Runtz</Title>
        <Desc> Sativa Dominant 60% THC 22% CBD 0.2%</Desc>
        <Price> 800</Price>
      </InfoContainer>
    </Wrapper>
    <Newsletter/>
    <Footer/>
  </Container>
  )
}

export default Product
